import React from "react";

import "./App.css";

function App() {
  const styles = ["border: 1px solid darkblue"];
  return (
    <div className="App">
      <div class="container">
        <div class="row">
          <div style={styles} class="col-sm border">
            1.
          </div>
          <div class="col-sm border">2.</div>
          <div class="col-sm border">3.</div>
          <div class="col-sm border">4.</div>
        </div>
      </div>
    </div>
  );
}

export default App;
